text:
{
  question: 'What is the purpose of the Vault Savings product?',
  response: 'The Vault Savings product is designed to help users build a savings culture by providing a locked savings account that cannot be accessed until the set tenure elapses. This ensures that users can save towards their goals without the temptation of withdrawing funds prematurely.'
}

{
  question: 'Can I add funds to my Vault Savings account at any time?',
  response: 'Yes, users can fund their Vault manually at any time. This flexibility allows users to save towards their goals whenever they have funds available.'
}

{
  question: 'How is the interest rate calculated on my Vault Savings account?',
  response: 'The interest rate on the Vault Savings account is calculated based on the tenure and amount saved. The longer the tenure and the larger the amount saved, the higher the interest rate.'
}

{
  question: 'How is the 1% fee calculated if I break my Vault Savings prematurely?',
  response: 'If a user wishes to break their Vault Savings prematurely, they will be charged a 1% fee on their savings. For example, if a user has saved #1,000 in their Vault and wishes to break it 6 months before the end date, they will be charged a fee of #10 (1% of #1,000).'
}

{
  question: 'Is my money safe in the Vault Savings account?',
  response: 'Yes, your money is safe in the Vault Savings account. We use secure technology and partner with reputable financial institutions to ensure the safety and security of your funds.'
}

{
  question: 'Can I withdraw my funds before the end date?',
  response: 'No, funds in the Vault Savings account cannot be withdrawn before the end date. This ensures that users can save towards their goals without the temptation of withdrawing funds prematurely.'
}

{
  question: 'How do I fund my virtual USD card?',
  response: 'You can fund your virtual USD card with your credit card or cash wallet. To fund your card with your credit card, you will need to enter your credit card information when you create your virtual USD card. To fund your card with your cash wallet, you will need to transfer money from your cash wallet to your virtual USD card.'
}

{
  question: 'How does the Vault Savings product work?',
  response: 'Users set an end date for their savings goal and can fund their Vault manually at any time. Once the funds are added to the Vault, they cannot be accessed until the end date is met. If a user wishes to break their Vault savings prematurely, they will be charged a 1% fee on their savings.'
}

{
  question: 'How do I make payments with my virtual USD card?',
  response: 'You can use your virtual USD card to make payments on streaming platforms such as Apple Music, Spotify, Amazon Prime, etc. You can also use your virtual USD card to shop on ecommerce websites like eBay, Amazon, and AliExpress.'
}

{
  question: 'What are the fees associated with using a virtual USD card?',
  response: 'There are no fees associated with using a virtual USD card. However, there may be fees associated with making payments on streaming platforms or shopping on ecommerce websites. These fees will be charged by the merchant, not by us.'
}

{
  question: 'What is the minimum balance requirement for a virtual USD card?',
  response: 'The minimum balance requirement for a virtual USD card is $1. If your balance falls below $1, your card will be terminated.'
}

{
  question: 'What is my Buy Now Pay Later repayment period?',
  response: 'Your Buy Now Pay Later repayment period is the number of tenure you choose to make your repayment ,ranging between 1 - 3 months.'
}

{
  question: 'Can I get another spending limit while having an active repayment tenure?',
  response: 'During an active repayment of your Buy Now Pay Later, you would not be able to access another spending limit until the current repayment is successfully completed.'
}

{
  question: 'What is my Bank Verification Number (BVN) used for?',
  response: 'We use your BVN to verify your identity in order to protect your CredPal account against fraud and impersonation. Your BVN is safe as your BVN does not provide us access to your bank account.'
}

{
  question: 'What is my Bank Verification Number (BVN) used for?',
  response: 'We use your BVN to verify your identity in order to protect your CredPal account against fraud and impersonation. Your BVN is safe as your BVN does not provide us access to your bank account.'
}

{
  question: 'What can I redeem rewards points for?',
  response: 'Your rewards can be redeemed to pay off your credit balance.'
}

{
  question: 'What rewards does CredPal’s Buy Now Pay Later offer?',
  response: 'CredPal offers exciting rewards and loyalty points. Loyalty points are earned on credit card payments. From time to time, cash backs are also available when you patronise CredPal’s merchant partners. To partner with CredPal as a merchant, please reach out to us at pay@credpal.com.'
}

{
  question: 'Are there any penalties for paying off my credit balance early?',
  response: 'No. On the contrary, we advise you to pay up your loan early, as this allows you to access unique incentives based on our discretion.'
}

{
  question: 'How do I pay my credit balance?',
  response: 'CredPal offers a hassle-free repayment. You may pay through a card you add to your account, which can be automatically charged or via bank transfer.'
}

{
  question: 'Is my CredPal account secure?',
  response: 'Yes, your CredPal account is 100% secured, we offer full protection from unauthorized transactions. You can trust that your finances are secured with us. Our support team is available for assistance on all related matters.If you notice a suspicious transaction, you can prevent additional fraudulent behaviour by freezing your card(s) or the said account.Kindly  Contact us at hello@credpal.com to stop any suspected form of fraud on your account.'
}

{
  question: 'How do I set up a Vault Savings account?',
  response: 'You can set up a Vault Savings account by creating an account on our platform and selecting the Vault Savings product. You will then be prompted to set your savings goal and end date. From there, you can fund your Vault manually at any time'
}

{
  question: 'What is CredPal’s Buy Now Pay Later privacy policy?',
  response: 'We understand that by using CredPal’s Buy Now Pay Later, you place your trust in us to handle your transactional data and personal information with the utmost discretion. We comply with standard practices in protecting your data and encrypting the details you supply.'
}

{
  question: 'How do I get a virtual USD card?',
  response: 'To get a virtual USD card, you can sign up for our service on our website. Once you have signed up, you will be able to create a virtual USD card.'
}

{
  question: 'Where can I use Buy Now Pay Later?',
  response: 'You can access CredPal’s Buy Now Pay Later with our merchant partners online and offline. Use Buy Now Pay Later in 3 ways:Visit ‘Shop’ on your mobile app Use CredPal at checkout on the merchant’s websiteScan our QR code in the merchant’s store.'
}

{
  question: 'How can I use CredPal’s Buy Now Pay Later (Shop) on my mobile app?',
  response: 'Offline Merchants - First, place your order with the merchant using their available contact information; IG, website, phone number. After confirming the purchase amount and delivery costs if applicable, return to the app to complete payment with your credit card or shopping limit.Online Merchants - Visit merchant’s website in app and checkout with CredPal.There are two payment options available; one-time payment and spread payment. With one-time payment, you pay the merchant directly from your credit card balance. This must be paid back at the end of each statement period.Using the spread payment option allows you access to credit above your credit card limit, which you can pay back over 2 - 6 months. This payment method is useful for large purchases. For order approval, you’re required to make a 30% downpayment.A transaction receipt is generated for both types of payments, which you can share with the merchant for order fulfilment.'
}

{
  question: 'Who can apply for Buy Now Pay Later?',
  response: 'Business owners and salary earners, so long as you meet the requirements, you would be eligible.'
}

{
  question: 'What is CredPal’s Buy Now Pay Later?',
  response: 'CredPal’s Buy Now Pay Later gives you access to buy any product from Credpals authorized merchant, make a down payment, then you can spread the remaining payment later, within a stipulated tenure as selected on the app.'
}

{
  question: 'What are the benefits of using CredPal’s Buy Now Pay Later?',
  response: 'The benefits of CredPal’s Buy Now Pay Later are:You can split payment for purchases up to 4 months You get rewards each time you use your credit card for payments with our merchant partners.As your credit card performance improves, your credit limit may be reviewed for an increase. That is, more funds at your disposal.'
}

{
  question: 'What is the cost associated with using CredPal’s Buy Now Pay Later?',
  response: 'Associated costs include payment for your preferred card plan, interest on the amount used and standard transaction charges.'
}
